import React from "react";

const Skills = ({ skillsData, bodyClassName }) => {
    const backgroundColor = bodyClassName == 'dark' ? "dark:bg-dark-grey" : "bg-white"

    return (
      <div className={`skills ${backgroundColor} text-custom-purple text-2xl p-8 w-8/12`}>
      <h2 className="text-4xl font-bold">{skillsData.titles[0]}</h2>
      <div className="grid grid-cols-2 gap-4 w-1/2 mt-4">
        {skillsData.skills.map((skill) => (
          <div key={skill.id} className="flex items-center p-4 text-gray-500 text-lg m-0">
            <img src={skill["img-link"]} alt={skill.alt} className="mr-2 w-10 h-10 rounded-full ml-0" />
            <span>{skill.alt}</span>
          </div>
        ))}
      </div>
      </div>
    );
};

export default Skills;
